import { Header } from "./homepage";
import { useNavigate } from "react-router";

function Main(props){
    let lgt=useNavigate();
function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token')
    lgt('/');

 }
    return(
        <div>
             <Header  navi={Logout}    login="LOGOUT" sidebar="mainsidebar"   loginfont='fa fa-usd' ></Header>
 

<main style={{margintop: "58px"}}>
  <div class="container pt-4">

  </div>
</main>

        </div>
    );
}

export default Main;
